    data: |
      SELECT * FROM tab1 AS cor0 WHERE NOT col2 NOT BETWEEN + - col1 AND + col2 * - - col1 * - - 62 + + 12 - - col2 + + col2 * + col2 / ( - col2 ) * col0;
  - name: tab1

outputs:
  - name: q3300.out
    data: |
      51	14	96
      85	5	59
      91	47	68
